# Part 1
array = []
total = 0
# Split by "double line break"
for x in group_markings.split("\n\n"):
    # Replace each single line break with nothing
    x = x.replace("\n", "")
    # Put this into a SET (finds unique characters)
    _set = set(x)
    # Count the number of letters in the array
    _len = len(_set)
    # Add it to the big group
    array.append(_len)
# Sum up all the numbers in the array
total = sum(array)
print(total)

# Part 2
freq = {}
totals = []
for g in group_markings.split('\n\n'):
    freq={}
    # Count how many times each question was answered
    for c in g.replace('\n', ''):
        if c in freq.keys():
            freq[c] += 1
        else:
            freq[c] = 1
    # How many people are there?
    num_people = len(g.split("\n"))

    total = 0
    # For each Value, if it matches the number of people, add 1 to total
    for key in freq:
        if freq[key] == num_people:
            total += 1
    # Add how many questions where answered by everyone to a running total
    totals.append(total)
# Sum it
print(sum(totals))